	<view class="content zero-padding user-page">
		<view class="user-header-region" v-if="userLogin">
			<view class="user-header">
				<image mode="aspectFill" :src="myHeader" />
			</view>
			<view style="width: 50upx;height: 20upx;"></view>
			<text style="color:white">{{userName}}</text>
			<view style="width: 50upx;height: 30upx;"></view>
		</view>
		
		<view class="user-header-region" v-if="!userLogin">
			<!-- <button class='cu-btn round login-btn' withCredentials="true" lang="zh_CN" @tap="loginPage">
				授权登录
			</button> -->
			<!-- #ifdef MP-WEIXIN -->
			<button class='cu-btn round login-btn' withCredentials="true" lang="zh_CN" @click="loginWX">
				授权登录
			</button>
			
			<view class="cu-modal" :class="modalName=='Image'?'show':''">
				<view class="cu-dialog">
					<view style="font-size:36upx; font-weight: 600;margin-top: 20upx;">您还未登陆</view>
					
					<view style="margin: 20upx 60upx 40upx 60upx;">请登录获取更多功能和信息。</view>
