			<uni-list-item class= "item-no-line" title="银行账户" show-extra-icon="true" :extra-icon="{color:'#9000ff',size:'22',type:'search'}" @click="accountRecord"></uni-list-item>
			<!-- <uni-list-item title="兑换记录" show-extra-icon="true" :extra-icon="{color:'#ec008c',size:'22',type:'heart-o'}" @click="exchangeRecord"></uni-list-item> -->
		</view>
		
		<view class="cu-bar bg-white solid-bottom margin-top"  v-if="userLogin">
