			</view>
		</view>
		<view class="cu-list menu" :class="[menuBorder?'sm-border':'',menuCard?'card-menu margin-top':'']" v-if="userLogin">
			<uni-list-item title="注销" show-extra-icon="true" :extra-icon="{color:'#49afcd',size:'22',type:'sign-out'}" @click="logout"></uni-list-item>
			<!-- <uni-list-item title="清空缓存" show-extra-icon="true" :extra-icon="{color:'#ff9700',size:'22',type:'trash'}" @click="cleanCache"></uni-list-item> -->
		</view>

		<view class="cu-bar bg-white solid-bottom margin-top">
			<view class="action">
				<text class="cuIcon-title text-green"></text> 其他信息
			</view>
		</view>
		<view class="cu-list menu" :class="[menuBorder?'sm-border':'',menuCard?'card-menu margin-top':'']">
			<uni-list-item title="意见反馈" show-extra-icon="true" :extra-icon="{color:'#ec008c',size:'22',type:'commenting-o'}" @click="comment"></uni-list-item>
			<uni-list-item title="关于我们" show-extra-icon="true" :extra-icon="{color:'#ff9700',size:'22',type:'list-alt'}" @click="aboutUs"></uni-list-item>
		</view>
		<view class="cu-list menu" :class="[menuBorder?'sm-border':'',menuCard?'card-menu margin-top':'']">
			<uni-list-item title="检查更新" show-extra-icon="true" :extra-icon="{color:'#5bb999',size:'22',type:'retweet'}" show-arrow="false" @click="checkNewVersion"></uni-list-item>
			<uni-list-item :title="'版本: ' + appVersion" show-extra-icon="true" :extra-icon="{color:'#1cbbb4',size:'22',type:'info-circle'}" show-arrow="false"></uni-list-item>
		</view>
		<view class="margin-top"></view>
		<!-- <view class="block-title">账户信息修改</view>
		<uni-list>
			<uni-list-item title="修改密码" show-extra-icon="true" :extra-icon="{color:'#00bf8f',size:'18',type:'key'}" @click="changePwd" v-if="email"></uni-list-item>
			<uni-list-item title="经纪认证" show-extra-icon="true" :extra-icon="{color:'#00bf8f',size:'18',type:'id-card'}" @click="agentAuth"></uni-list-item>
			<uni-list-item title="预约系统信息" show-extra-icon="true" :extra-icon="{color:'#00bf8f',size:'18',type:'black-tie'}" show-switch="true" show-arrow="false" @switchChange="switchChange"></uni-list-item>
			<uni-list-item title="清除TREB信息" show-extra-icon="true" :extra-icon="{color:'#00bf8f',size:'18',type:'compass'}" show-switch="true" show-arrow="false" @switchChange="switchChange"></uni-list-item>
		</uni-list>
		<view class="block-title" >注销</view>
		<uni-list>
			<uni-list-item title="注销" @click="bindLogout" show-extra-icon="true" :extra-icon="{color:'#00bf8f',size:'18',type:'unlock'}" show-arrow="false"></uni-list-item>
			<uni-list-item title="已使用5M缓存" show-extra-icon="true" :extra-icon="{color:'#00bf8f',size:'18',type:'trash'}" show-arrow="false"></uni-list-item>
		</uni-list>
		<view class="block-title">联系我们</view>
		<uni-list>
			<uni-list-item title="分享给朋友" show-extra-icon="true" :extra-icon="{color:'#00bf8f',size:'18',type:'share'}"></uni-list-item>
		</uni-list>
		
		<view class="content">
			<view>
				<button v-if="!hasLogin" type="primary" class="background-main-color" @tap="bindLogin">登录</button>
				<button v-if="hasLogin" type="default" @tap="bindLogout">退出登录</button>
			</view>
		</view> -->
	</view>
</template>

<script>
	import uniList from '@/components/uni-list/uni-list.vue'
	import uniListItem from '@/components/uni-list-item/uni-list-item.vue'
	import {logoutHandle,loginHandle,forcedLogin,isLogin,authRequestMap,notLoginHandle,setUserInfo,getUserInfo,requestUserAgentInfo,zRequestMap,appVersion,checkVersion} from '@/common/js/util.js'
	
    export default {
		components: {
			uniList,
			uniListItem,
		},
		data() {
			return {
				userLogin: false,
				defaultUserHeader:"https://youju.nyc3.digitaloceanspaces.com/PublicImage/Other/img1.png",
				userHeader:"",
				userName:"",
				extraIcon: {
					color: '#007aff',
					size: '22',
					type: 'heart'
				},
				index: 0,
				email : '',
				menuBorder: true,
				menuArrow: false,
				menuCard: true,
				modalName: null,
				agentInfo: {name: ''}
			};
		},
		computed:{
			hasLogin(){
				return isLogin()  && true;
			},
			myHeader(){
				return this.userHeader || this.defaultUserHeader;
			},
			appVersion(){
				return appVersion
			}
		},
		onLoad() {
		},
        methods: {
			loginPage(){
				uni.navigateTo({
					url: '/pages/login/login'
				})
			},
            wxGetUserInfo() {
				var _this = this;
				uni.showLoading({
					title: "加载中...",
					mask: false
				});
                uni.getUserInfo({
                    provider: 'weixin',
                    success: function(infoRes) {
						console.log(infoRes.userInfo);
                        var nickName = infoRes.userInfo.nickName; //昵称
                        var avatarUrl = infoRes.userInfo.avatarUrl; //头像
						var ge = infoRes.userInfo.gender;
						uni.login({
							provider: 'weixin',
							success: function(loginRes) {
								var code = loginRes.code;
								zRequestMap("/api/user/MWechatLogin", { code:code,avatar:avatarUrl, name:nickName, ge:ge}, "POST").then(
									function(result){
										uni.hideLoading();
										if(result.success){
											var seessionKey = result.data.data.Session;
											var token = result.data.data.Token;
											var id = result.data.data.Id
											loginHandle(token,id);
											setUserInfo({avatar:avatarUrl, name:nickName, id: id});
											_this.userLogin = true;
											_this.userHeader = avatarUrl;
											_this.userName = nickName;
										}else{
											uni.showToast({
												icon:'none',
												title:  result.message,
												mask: true,
												duration: 2000
											});
										}
									}
								)
						}});
                    },
                    fail(res) {uni.hideLoading()}
                });
            },
			loginWX(){
				this.modalName = "Image"
			},
			hideModal(e) {
				this.modalName = null
			},
			userRecord(){
				uni.navigateTo({
					url: '/pages/info/user-record'
				});
			},
			accountRecord(){
				uni.navigateTo({
					url: '/pages/info/account-record'
				});
			},
			exchangeRecord(){
				uni.navigateTo({
					url: '/pages/index/transaction'
				});
			},
			logout(){
				var _this = this;
				uni.showModal({
					title: "注销",
					content: "确定要注销账户吗?",
					showCancel: true,
					cancelText: "取消",
					confirmText: "确定",
					confirmColor: '#ec008c',
					fail() {
						console.log("user page logout fail")
					},
					success(e) {
						if(e.confirm){
							_this.bindLogout()
						}
						console.log("user",e)
					}
				})
			},
			cleanCache(){
				console.log("clean cache")
			},
			comment(){
				uni.navigateTo({
					url: '/pages/user/feedback'
				});
				console.log("comment")
			},
			checkNewVersion(){
				checkVersion(true)
			},
			aboutUs(){
				uni.navigateTo({
					url: '/pages/user/aboutUs'
				});
				console.log("about us")
			},
            bindLogin() {
                uni.navigateTo({
                    url: '../login/login',
                });
            },
            bindLogout() {
				this.modalName = null
                logoutHandle();
				this.userLogin = false;
            },
			agentAuth(){
				uni.navigateTo({
					url:'/pages/user/agent-auth',
				})
			},
			agentMain(){
				let _this = this
				let agentIn = this.agentInfo
				var newInfo = {}
				for (var i in agentIn) {
					newInfo[i] = encodeURIComponent(agentIn[i])
				}
				if (agentIn){
					uni.navigateTo({
						url: '/pages/agent-page/agent-page?agentInfo=' + JSON.stringify(newInfo)
					});
				}else{
					uni.showModal({
						title: "请在用户页面验证经纪信息",
						confirmText:"去设置",
						showCancel:true,
						confirmColor:"#00bf8f",
						success(e) {
							if (e.confirm){
								uni.navigateTo({
									url:'/pages/user/agent-auth',
								})
							}
						}
					})
				}
			},
			bookSetting(){
				uni.navigateTo({
					url: '/pages/user/book-setting'
				});
			},
			changePwd(){
				var _this = this;
				uni.navigateTo({
					url:'/pages/pwd/pwd-change?email=' + _this.email,
				})
			},
        },
		onShow(){
			var _this = this;
			_this.userLogin = isLogin() && true;

			if(_this.userLogin){
			// #ifdef MP-WEIXIN
                uni.getUserInfo({
                    provider: 'weixin',
                    success: function(infoRes) {
						_this.userHeader = infoRes.userInfo.avatarUrl || "";
						_this.userName = infoRes.userInfo.nickName || "";
					},
                    fail(res) {}
                });
			// #endif

			// #ifdef APP-PLUS
				var user = getUserInfo();
				if(user){
					_this.userHeader = user.avatar || "";
					_this.userName = user.name || "";
				}
			// #endif
				requestUserAgentInfo()
				let _this = this
				setTimeout(function(){
					_this.agentInfo = uni.getStorageSync("user:agent:info")
					if (_this.agentInfo.name != ''){
						uni.setStorageSync("user:agentInfo")
					}
					console.log("sett",_this.userAgentInfo)
				}, 2000);
			}

// 			console.log(this.userLogin);
// 			var response = await authRequestMap('/api/user/info');
// 
// 			if(response && response.success && response.data && response.data.data && response.data.data){
// 				console.log(response);
// 				var userObj = response.data.data.data;
// 				setUserInfo(userObj);
// 				this.email = userObj.email;
// 				this.userHeader = userObj.agent.header || "";
// 				this.userName = userObj.agent.name || userObj.email
// 			}
		},
		onShareAppMessage(res) {
			return {
			  title: '栏目分享',
			  path: '/pages/detail/category-detail?id=' + this.info.id
			}
		}
    }
</script>

<style>
	.user-page{
		background: #fafafa;
	}
	.user-header-region{
		width: 100%;
		height: 500upx;
		background: url('data:image/jpeg;base64,');
		background-size:100% 100%;
		background-repeat: no-repeat;
		
		display: inline-flex;
		flex-direction: column;
		justify-content: flex-end;
		align-items: center;
		text-align: center;
	}
	
	.login-btn{
		position: relative;
		top: -40%;
	}
	
	.user-header{
		width:200upx;
		height:200upx;
		border-radius: 50%;
		border: 2px solid #dddddd;
		overflow: hidden;
	}
	
	.user-header>image{
		width: 100%;
		height: 100%;;
	}
	
</style>
